//歌手榜
module.exports = (req, res, createWebAPIRequest, request) => {
  const cookie = req.get("Cookie") ? req.get("Cookie") : "";
  const data = {
    type: req.query.type,
    csrf_token: ""
  };
  createWebAPIRequest(
    "music.163.com",
    "/eapi/toplist/artist?",
    "POST",
    data,
    cookie,
    music_req => {
      res.send(music_req);
    },
    err => res.status(502).send("fetch error")
  );
};
